A todas las jovencitas las pone cachondas sus profesores particulares. Te vienen a casa, se sientan a tu lado, te hablan bajito... Asi es como Blue Angel se ha puesto como una moto y al mas minimo despiste de Toni le ha bajado los pantalones. El final de la leccion ya lo sabemos todos. Toni Ribas hace visitas en casa de algunas pornostars del momento. Hoy le toca el turno a Blue Angel que le recibira ligerita de ropa para ponerselo mas facil.
